import {
  Suggestion
} from "./chunk-P5JGOPVX.js";
import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Modals/General/suggestion.ts
init_esm_shims();
var suggestion_default = {
  id: "suggestion",
  async execute(interaction, client) {
    const type = interaction.fields.getTextInputValue("type");
    if (type != "1" && type != "2") return interaction.reply({ content: `Ung\xFCltiger Typ`, ephemeral: true });
    const suggestionText = interaction.fields.getTextInputValue("suggestion");
    const channel = client.channels.cache.get("1230234007854120960" /* suggestion */);
    const suggestion = new Suggestion({
      user: interaction.user.id,
      suggestion: suggestionText,
      type: parseInt(type)
    });
    await suggestion.submit(channel);
    interaction.reply({ content: `Dein Vorschlag wurde erfolgreich eingereicht`, ephemeral: true });
  }
};
export {
  suggestion_default as default
};
